import React from 'react'
import { Link } from 'react-router-dom';
import AxiosRequest from '../../axios';
import { useNavigate } from 'react-router';




const Logout = () => {
    const navigate = useNavigate();

    const handleLogout = () => {

        // localStorage.removeItem('access_token')
        // localStorage.removeItem('refresh_token')
        // AxiosRequest.defaults.headers['Authorisation'] =null;
        navigate("/login");
    }
    return (

        <div className="modal fade" id="staticBackdrop" data-bs-backdrop="static" data-bs-keyboard="false" tabindex="-1" aria-labelledby="staticBackdropLabel" aria-hidden="true">
        <div className="modal-dialog">
          <div className="modal-content">
            <div className="modal-header">
              <h5 className="modal-title" id="staticBackdropLabel">Modal title</h5>
              <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
            </div>
            <div className="modal-body">
              ...
            </div>
            <div className="modal-footer">
              <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">Take me back</button>
              <button type="button" className="btn btn-primary" data-bs-dismiss="modal">Logout</button>
            </div>
          </div>
        </div>
      </div>
    )
}

export default Logout;
